import "./App.css";
import styled from "styled-components";
import logo from "./Frame 2566.svg";
import desconto from "./desconto.svg";
import gift from "./gift.svg";
import frete from "./frete.svg";

const MainHeader = styled.div``;
const HeaderWrapp = styled.div``;
const TopBar = styled.div`
background: #125950;
display: flex;
flex-wrap: nowrap;
flex-direction: row;
align-content: center;
align-items: center;
justify-content: space-between;
`;
const HomeHeader = styled.div`
  background: #5b945b;
  color: #fff;
  width: 100%;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 24px 64px;
  align-content: center;
  align-items: center;
`;

const Desconto = styled.div`
  width: 18%;
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  align-items: center;
  justify-content: space-between;
  color: #fff;
  font-weight: 600;
  padding-top: 12px;
  padding-left: 16px;
  padding-bottom: 9px;
`;

const GiftCard = styled.div`
  width: 32%;
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  align-items: center;
  justify-content: flex-end;
  color: #fff;
  font-weight: 600;
  padding-top: 12px;
  padding-left: 16px;
  padding-bottom: 9px;
  align-content: center;
`;

const FreteP = styled.p `
  color: #fff;
  margin-right: 16px;
  margin-left: 16px;
`;
const Frete = styled.div `
  width: 32%;
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  align-content: center;
  justify-content: flex-end;
  align-items: center;
`;


function App() {
  return (
    <div className="App">
      <MainHeader>
        <HeaderWrapp>
          <TopBar>
            <Desconto>
              <img src={desconto} className="descontoIcon" />
              <p>Desconto de 10% na primeira compra</p>
            </Desconto>
            <GiftCard>
              <img src={gift} className="giftIcon" />
              <p>Ganhe R$ 50,00</p>
            </GiftCard>
            <Frete>
              <img src={frete} className="freteIcon" />
              <p>Entrega de até 48 horas para RJ e SP</p>
            </Frete>
          </TopBar>
          <HomeHeader>
            <div className="logo">
              <img src={logo} className="App-logo" alt="logo" />
            </div>
            <div className="menu">
              <nav>
                <a href="#">Notícias</a>
                <a href="#">Tratamentos</a>
                <a href="#">Produtos</a>
                <a href="#">Soluções Cannect</a>
              </nav>
            </div>
            <div className="btns">
              <button>Profissionais</button>
              <button>Pacientes</button>
            </div>
          </HomeHeader>
        </HeaderWrapp>
      </MainHeader>
    </div>
  );
}

export default App;
